<h2><a name='sect2' href='#toc2'>C]prted [options]R]Description</a></h2>
<p>
C]prtedR] starts an PRTE daemon for the PRTE
system.
<h2><a name='sect3' href='#toc3'>Note</a></h2>
<p>
The C]prtedR]
<dl>

<dt>command is I]not intended to be manually invoked
</dt>
<dd>by end users.R] It is part of the PRTE architecture and is invoked automatically
as necessary. This man page is mainly intended for those adventerous end
users and system administrators who have noticed an C]prtedR] process and
wondered what it is. </dd>
</dl>
<p>
As such, the command line options accepted by the C]prtedR]
are not listed below because they are considered internal and are therefore
subject to change between versions without warning. Running C]prtedR] with
the C]--helpR] command line option will show all available options.
